import React from 'react';
import { Routes, Route, Link, Navigate, useNavigate } from 'react-router-dom';
import { useEffect, useState } from 'react';
import Login from './auth/Login';
import PatientDashboard from './pages/PatientDashboard';

// Navbar INT√âGR√â (AUCUN import externe)
const Navbar = () => {
  const navigate = useNavigate();
  const [token, setToken] = useState(localStorage.getItem('token'));

  const handleLogout = () => {
    localStorage.removeItem('token');
    setToken(null);
    navigate('/');
  };

  return (
    <nav className="bg-white shadow-xl border-b-4 border-blue-100 sticky top-0 z-50">
      <div className="max-w-6xl mx-auto px-6 py-4">
        <div className="flex items-center justify-between">
          <Link to={token ? '/patient' : '/'} className="flex items-center space-x-3">
            <div className="w-12 h-12 bg-gradient-to-br from-blue-600 to-purple-600 rounded-2xl flex items-center justify-center shadow-lg">
              <span className="text-2xl font-bold text-white">GM</span>
            </div>
            <span className="text-3xl font-bold bg-gradient-to-r from-blue-700 to-purple-700 bg-clip-text text-transparent">
              GOVAIMED
            </span>
          </Link>

          <div className="flex items-center space-x-4">
            {token ? (
              <>
                <Link to="/patient" className="px-6 py-2 text-lg font-semibold text-blue-600 hover:bg-blue-50 rounded-xl transition-all">
                  Dashboard
                </Link>
                <button
                  onClick={handleLogout}
                  className="px-8 py-3 bg-gradient-to-r from-red-500 to-red-600 text-white font-bold rounded-xl hover:shadow-xl transition-all shadow-lg"
                >
                  D√©connexion
                </button>
              </>
            ) : (
              <Link
                to="/login"
                className="px-10 py-3 bg-gradient-to-r from-blue-600 to-blue-700 text-white font-bold text-xl rounded-2xl hover:shadow-2xl transition-all shadow-xl"
              >
                Se connecter
              </Link>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

// Home INT√âGR√â 
const Home = () => (
  <div className="min-h-screen bg-gradient-to-br from-indigo-50 via-blue-50 to-purple-50 py-24 px-6">
    <div className="max-w-5xl mx-auto text-center">
      <div className="w-32 h-32 bg-gradient-to-r from-blue-500 via-purple-500 to-indigo-500 rounded-3xl mx-auto mb-8 shadow-2xl flex items-center justify-center">
        <span className="text-4xl font-bold text-white">üè•</span>
      </div>
      <h1 className="text-5xl md:text-7xl font-black bg-gradient-to-r from-gray-900 via-blue-900 to-purple-900 bg-clip-text text-transparent mb-8 leading-tight">
        GOVAIMED
      </h1>
      <p className="text-xl md:text-2xl text-gray-700 mb-12 max-w-3xl mx-auto leading-relaxed">
        Votre portail m√©dical intelligent pour une sant√© accessible, rapide et s√©curis√©e
      </p>
      <div className="flex flex-col sm:flex-row gap-4 justify-center items-center">
        <Link
          to="/login"
          className="px-12 py-5 bg-gradient-to-r from-blue-600 to-blue-700 text-white text-xl font-bold rounded-2xl hover:shadow-2xl transition-all shadow-xl hover:-translate-y-1 hover:scale-105"
        >
          üöÄ Se connecter
        </Link>
        <Link
          to="/register"
          className="px-12 py-5 border-4 border-purple-500 text-purple-700 text-xl font-bold rounded-2xl hover:bg-purple-50 transition-all shadow-xl hover:shadow-2xl hover:-translate-y-1"
        >
          ‚ú® S'inscrire
        </Link>
      </div>
    </div>
  </div>
);

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-1">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Login />} />
          <Route path="/patient/*" element={<PatientDashboard />} />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      <footer className="bg-gradient-to-r from-gray-900 to-gray-800 text-white py-12 mt-24 border-t-4 border-indigo-500">
        <div className="max-w-6xl mx-auto px-6 text-center">
          <div className="flex justify-center items-center space-x-6 mb-6">
            <span className="text-2xl">üìß contact@govaimed.com</span>
            <span className="text-2xl">üìû +221 77 123 45 67</span>
          </div>
          <p className="text-2xl font-bold mb-4">GOVAIMED ¬© 2026</p>
          <p className="text-gray-400 text-lg">Plateforme m√©dicale innovante - Dakar, S√©n√©gal</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
